import { usersRedux } from "../redusers";

export const fetchLesson = () =>{
    return function ( dispatch ) {
        fetch('https://api.escuelajs.co/api/v1/users')
        .then(res => res.json())
        .then(user => dispatch(user(user)));
    }
}
